import React from 'react';
import BlogPost from './BlogPost';
import BlogSidebar from './BlogSidebar';

function MainContent() {
  return (
    <>
      <div className="col-md-8">
        <BlogPost />
        <BlogPost />
        <BlogPost />
      </div>
      <div className="col-md-4">
        <BlogSidebar />
      </div>
    </>
  );
}

export default MainContent;
